import React from 'react'
import yossi from '../../../assets/rectangle.png';
import './Chef.scss';
const Chef = () => {
  return (
    <div><p>CHEF OF THE WEEK :</p>
    <img src={yossi} alt="yossi"><div className='rectangle'></div></img></div>
  )
}

export default Chef;
